-- ----------------------------
-- Table structure for maoding_web_company_user
-- ----------------------------
DROP TABLE IF EXISTS `maoding_web_company_user`;
CREATE TABLE `maoding_web_company_user` (
  `id` varchar(32) NOT NULL COMMENT '主键id，uuid',
  `company_id` varchar(32) DEFAULT NULL COMMENT '公司id',
  `user_id` varchar(32) DEFAULT NULL COMMENT '用户id',
  `user_name` varchar(30) DEFAULT NULL COMMENT '姓名',
  `relation_type` varchar(1) DEFAULT NULL COMMENT '关联类别(1.自己创建的组织；0.我申请，2.受邀请)',
  `audit_status` varchar(1) DEFAULT NULL COMMENT '审核状态(0.申请加入，1.审核通过，2.邀请加入，3.审批拒绝。4:离职。自己创建的企业此字段为1)',
  `employee_type` varchar(32) DEFAULT NULL COMMENT '员工类别（全职或兼职）',
  `employee_status` varchar(32) DEFAULT NULL COMMENT '员工状态(在职或离职)',
  `entry_time` date DEFAULT NULL COMMENT '入职时间',
  `departure_time` date DEFAULT NULL COMMENT '离职时间',
  `illustration` varchar(500) DEFAULT NULL COMMENT '说明',
  `phone` varchar(50) DEFAULT NULL COMMENT '联系号码',
  `email` varchar(100) DEFAULT NULL COMMENT '邮箱（所在公司邮箱）',
  `departure_reason` varchar(500) DEFAULT NULL COMMENT '离职原因',
  `remark` varchar(150) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `seq` int(11) DEFAULT '0' COMMENT '排序字段',
  `pin_yin` varchar(100) DEFAULT NULL COMMENT '姓名的拼音',
  PRIMARY KEY (`id`),
  KEY `company_id` (`company_id`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='企业用户关联表';

